import React,{createContext,useContext,useState} from 'react'
import './Withdraw.css'
import Modall from './Modal'
import { useNavigate } from 'react-router-dom'
import {WithdrawState,BalanceState} from '../App'
import { set, useForm } from 'react-hook-form'
import { yupResolver } from '@hookform/resolvers/yup'
import * as yup from 'yup'
import { AppState,DepositState } from '../App' 
import WithdrawModal from './WithdrawModal'
import WithdrawInsufficent from './WithdrawInsufficent'
import WithdrawMessage from './WithdrawMessage'
import Login from './Login'

const schema = yup.object().shape({
  withdraw:yup.number().required().positive()

})

const Withdraw = ({setModal,openmodal}) => {
  const navigate = useNavigate()
   const {amountDeposit} = useContext(DepositState)
   const {amountBalance,setBalance} = useContext(BalanceState)
   const {amountWithdraw,setWithdraw} = useContext(WithdrawState)
   const {userInfo} = useContext(AppState)


   const [show,setShow] = useState(false)
   const [holdShow,setHoldShow] = useState(false)
   const [showmessage,setShowMessage] = useState(false)
   const [handleShow,setHandleShow]= useState(false)
   const {register,handleSubmit,formState:{errors}} = useForm({
      resolver:yupResolver(schema)
   })
   const OnWithdraw = (data,e)=>{
      e.preventDefault(data)


      if(data.withdraw >= amountDeposit.deposit)
      {
        setShow(false)
        setShowMessage(true)
          setHandleShow(true)

      }else{
         setShow(true)
         setWithdraw(data)

         if(amountWithdraw.withdraw < 10000)
         {
              if(amountDeposit.deposit > (amountWithdraw.withdraw+50))
              {
                setBalance(amountDeposit.deposit-amountWithdraw.withdraw-50)
                setHandleShow(false)
                 setHoldShow(true)
                 nav

              }else{
                 setHandleShow(true)
                 setShowMessage(true)

              }  


         }else if(amountWithdraw.withdraw >= 1000 &&  amountWithdraw.withdraw < 5000)
         {  
          if(amountDeposit.deposit > (amountWithdraw.withdraw+100))
          {
            setBalance(amountDeposit.deposit - amountWithdraw.withdraw -100)
            setHandleShow(false)
            setHoldShow(true)

          }else{

            setHandleShow(true)
            setShowMessage(true)
          }

         }else if(amountWithdraw.withdraw >= 5000 && amountWithdraw.withdraw <10000) {

          if(amountDeposit.deposit > (amountWithdraw.withdraw+180))
            {
              setBalance(amountDeposit.deposit-amountWithdraw.withdraw -180)
              setHoldShow(true)


            }else{

                setHandleShow(true)
                setShowMessage(true)
            }

         }else if(amountWithdraw.withdraw >= 10000 && amountWithdraw.withdraw <30000){
          if(amountDeposit.deposit > (amountWithdraw.withdraw+285))
          {
            setBalance(amountDeposit.deposit - amountWithdraw.withdraw - 285)
            setHandleShow(false)
            setHoldShow(true)

          }else
          {
            setHandleShow(true)
            setShowMessage(true)
          }

         }else if(amountWithdraw.withdraw >= 30000 && amountWithdraw.withdraw < 100000 )
         {
          if(amountDeposit.deposit > (amountWithdraw.withdraw+500))
          {

            setBalance(amountDeposit.deposit - amountWithdraw.withdraw - 500)
             setHoldShow(true)
            setHandleShow(false)



          }else{

              setHandleShow(true)
              setShowMessage(true)
          }

         }else if (amountWithdraw.withdraw >= 100000)
         {  

          if(amountDeposit.deposit > (amountWithdraw.withdraw+1500))
                 setBalance(amountDeposit.deposit - amountWithdraw.withdraw -1500)
                setHandleShow(false)
                setHoldShow(true)

         }else{
            setHandleShow(true)
            setShowMessage(true)
         }

    } 


       console.log(data)
    }


   console.log(amountWithdraw.withdraw)

  return (
    <div className='deposit'>

        { show && !errors.withdraw && <WithdrawModal showmodal={show} setModal={setShow}/>}
        { showmessage && handleShow &&  <WithdrawMessage message={showmessage} setMessage={setShowMessage}/>}

       <div className='withdraw__menu'>
            <h2 className='withdraw__menu__title'>Withdraw Transaction Costs</h2>
            <h3 className='content'>For withdraws les than 1000, transaction cost is 50</h3>
            <h3 className='content'>For withdraws more than 1000 and  less than 5000, transaction cost is 100</h3>
            <h3 className='content'>For withdraws more than 5000 and less than 10000, transaction cost is 180</h3>
            <h3 className='content'>For withdraws more than 1000 and less than 30000, transaction cost is 285</h3>
            <h3 className='content'>For withdraws more than 30000 and less than 100000, transaction cost is 500</h3>
            <h3 className='content'>For withdraws more than 100000, transaction cost is 1500 </h3>

      </div>

        <h2>Welcome {userInfo.Fname}</h2>
     <div className='main'>
       <form className='deposit__form' onSubmit={handleSubmit(OnWithdraw)}>
            <label className='deposit__label'>How much do you want to withdraw</label>
           <input type='text' name='withdraw' className='deposit__input'
          {...register('withdraw')}  autoComplete='off' />




         <div>
           <button className='withdraw__button' onClick={()=>{  
              { !errors.deposit && setShow(true)}   
           }} > Withdraw</button>

       </div>
    </form>


 </div>


</div>

  )
 }

export default Withdraw
